import React from 'react';
import './App.css';
import Button from './components/Button';
import logo from './hacker-news.svg'

function App() {
  return (
    <div className="App">
      <h1>Kazool App</h1>
      <p>Get the kazool app and get up-to-date images on device. Available for mobile, tablets and desktop</p>
      <Button />
    </div>
  );
}

export default App;
